import React from "react";

const ToDo = ({id, name}) => {

  return (
    <>
    <div key={id} className="todo">
        <li>{name}</li>
    </div>
    {/* <p onClick={() => removeBox(id)}>X</p> */}
    </>
  )
}

export default ToDo;
